    this.state = {
      data: null,
    };
    fetch("https://back.staging.bsport.io/api/v1/offer/?company=6&only_future=true")
        .then(res => res.json())
        .then(
            (result) => {
              this.setState({data : result["results"]});
            });

  }
   render() {
    return (this.state.data);
  }
}


